import React from "react";
import pokemons from "../data";
import Pokemon from "./Pokemon";

class Cards extends React.Component {
  render() {
    return (
      <div>
        {
        pokemons.map((pokemon) => <Pokemon pokemonInfo={pokemon}/>)
        }
      </div>

    );
  }
}

export default Cards;
